import React, { useState } from 'react';
import { BrowserRouter as Router, Route, Routes } from 'react-router-dom';
import NavBar from './components/navbar';
import CreateItinerary from './pages/create-itinerary';
import MyTrips from './pages/mtrips';
import Home from './pages/home';
import MyAccount from './pages/my-account';
import AuthPage from './pages/auth-page';
import AuthProviderWithNavigate from './contexts/AuthProviderWithNavigate';
import PrivateRoute from './components/PrivateRoute';
import 'bootstrap/dist/css/bootstrap.min.css';

function App() {
    const [trips, setTrips] = useState([]);

    const addDestination = (destination) => {
        setTrips([...trips, destination]);
    };

    const removeDestination = (index) => {
        setTrips(trips.filter((_, i) => i !== index));
    };

    return (
        <Router>
            <AuthProviderWithNavigate>
                <NavBar />
                <Routes>
                    <Route path="/auth" element={<AuthPage />} />
                    <Route path="/" element={<PrivateRoute><Home /></PrivateRoute>} />
                    <Route path="/create-itinerary" element={<PrivateRoute><CreateItinerary addDestination={addDestination} trips={trips} removeDestination={removeDestination} /></PrivateRoute>} />
                    <Route path="/my-trips" element={<PrivateRoute><MyTrips trips={trips} removeDestination={removeDestination} /></PrivateRoute>} />
                    <Route path="/my-account" element={<PrivateRoute><MyAccount /></PrivateRoute>} />
                </Routes>
            </AuthProviderWithNavigate>
        </Router>
    );
}

export default App;
